import java.io.IOException;
import java.math.BigInteger;

public class A2 {
    public static void main(String[] args) throws IOException {
        BigInteger n = new BigInteger("");
        BigInteger eA = new BigInteger("65537");
        BigInteger cA = new BigInteger("");
        BigInteger eB = new BigInteger("65539");
        BigInteger cB = new BigInteger("");

        if(eA.gcd(eB).intValue()==1) {
            BigInteger q,r;
            BigInteger xi_2 = new BigInteger("1");
            BigInteger yi_2 = new BigInteger("0");
            BigInteger xi_1 = new BigInteger("0");
            BigInteger yi_1 = new BigInteger("1");
            BigInteger xi, yi;
            do{
                q = eA.divide(eB);
                r = eA.mod(eB);
                eA = eB;
                eB = r;
                xi = xi_2.subtract(q.multiply(xi_1));
                yi = yi_2.subtract(q.multiply(yi_1));
                xi_2 = xi_1;
                xi_1 = xi;
                yi_2 = yi_1;
                yi_1 = yi;
            }while(r.longValue()!=1);
            if(yi.compareTo(BigInteger.valueOf(0))==-1) {
                yi = yi.negate();
                cB = cB.modInverse(n);
            }
            if(xi.compareTo(BigInteger.valueOf(0))==-1) {
                xi = xi.negate();
                cA = cA.modInverse(n);
            }
            System.out.println("credit card number m: "+(cA.modPow(xi,n).multiply(cB.modPow(yi,n))).mod(n));
        }
    }
}